sys_script_include.script:
function isTimeStartBeforeTimeEnd(strStart, strEnd) {
	// Create GlideDateTime objects for the time start and time end
	var timeStart = new GlideDateTime(strStart);
	var timeEnd = new GlideDateTime(strEnd);
	// If the timeStart is before timeEnd, return true, else return false
	if (timeStart.before(timeEnd)) {
		return true;
	}
	else {
		return false;
	}
}
